import React from 'react';
import { Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Dashboard = () => {
    return (
        <div>
            <div>
                <div>
                <Nav.Link><Link className="nav-link " to="/products">EXPLORE<Link/></Link></Nav.Link>
                <Nav.Link><Link className="nav-link " to="/products">EXPLORE<Link/></Link></Nav.Link>
                <Nav.Link><Link className="nav-link " to="/products">EXPLORE<Link/></Link></Nav.Link>
                <Nav.Link><Link className="nav-link " to="/products">EXPLORE<Link/></Link></Nav.Link>
                <Nav.Link><Link className="nav-link " to="/products">EXPLORE<Link/></Link></Nav.Link>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
